,p_list_item_display_sequence=>20
,p_list_item_link_text=>'&APP_USER. &AD_ROLE_NAME.'
,p_list_item_link_target=>'#'
,p_list_item_icon=>'fa-user'
,p_list_item_disp_cond_type=>'USER_IS_NOT_PUBLIC_USER'
